import React,{useEffect,useState} from 'react'
import axios from 'axios'

function Shop(props) {
   
    return (
        <div>
            {
                props.paltar.map((index,key)=>
                <div key={key}>
                    <h4>{index.dressName}</h4>
                    <h6>{index.price}$</h6>
                    <img src={index.url}></img>
                    </div>)
            }
        </div>
    )
}

export default Shop
